import React, { useState } from "react";
import { AiOutlineMenu, AiOutlineClose } from "react-icons/ai";

const Navbar = () => {
  const [nav, value] = useState(false);
  const navM = () => {
    value(!nav);
    console.log(!nav);
  };
  return (
    <div className="container relative  mx-auto flex h-24 max-w-[1240px] items-center justify-between border-y-0 border-s-slate-500 bg-slate-700 p-5 text-basefont shadow-md sm:max-w-full lg:px-24 lg:py-6">
      <h1 className="text-3xl font-bold text-green-400 ">React App</h1>
      <ul className=" hidden font-sans text-[0.95rem] font-bold text-slate-300 md:flex">
        <li className="px-2">Home</li>
        <li className="px-2">About</li>
        <li className="px-2">Porfolio</li>
        <li className="px-2">Source</li>
        <li className="px-2">Project</li>
      </ul>
      <div className="flex md:hidden" onClick={navM}>
        {!nav ? <AiOutlineMenu size={20} className="  text-slate-300"></AiOutlineMenu> : <AiOutlineClose size={20} />}
      </div>
      <div className={!nav ? "hidden duration-200 ease-in-out" : "fixed top-0  h-full w-[60%] border-r border-slate-600 bg-basecolor px-2 py-5 text-basefont duration-1000 ease-in-out md:hidden"}>
        <h1 className=" pt-2 text-3xl font-bold text-green-400 ">React App</h1>
        <ul className="  pr-5 pt-[50px] text-[0.9rem] uppercase">
          <li className=" border-b py-[13px]">Home</li>
          <li className=" border-b py-[13px]">About</li>
          <li className=" border-b py-[13px]">Porfolio</li>
          <li className=" border-b py-[13px]">Source</li>
          <li className=" border-b py-[13px]">Project</li>
        </ul>
      </div>
    </div>
  );
};

export default Navbar;
